import './Blog.css'

import { Container } from "react-bootstrap";

function Blog(){
    return(
        <div>
            <Container fluid>
                <div class = "blog">
                    <h3 className = "blog__title">Our Blogs</h3>
                </div>
            </Container>
        </div>
    )
}

export default Blog
